import "./intro.scss";
import { init } from "ityped";
import { useEffect, useRef } from "react";

export default function Intro() {


  return (
    <div className="intro" id="intro">
      <div className="left">
        <div className="imgContainer">
          <img src="assets/rumi.png" alt="" />
        </div>
      </div>
      <div className="right">
        <div className="wrapper">
          <span>I am <b>Masuma Akter Rumi</b>, working as an <b>Application Developer</b> in 
          College of Public Health at University of Iowa. I have completed my Master's from department
          of Computer Science in University of Iowa.
          </span>
          
       
        </div>
        <a href="#portfolio">
          <img src="assets/down.png" alt="" />
        </a>
      </div>
    </div>
  );
}
